<template>
    <div>

        <b-form @submit="checkForm" inline>

            <b-form-group id="input-group-2" label-for="input-2">
            <b-input-group prepend="Tipo identificación:" class="mb-2 mr-sm-2 mb-sm-0">
                <b-form-select
                id="inline-form-custom-select-pref"
                required
                v-model="tipoid"
                class="mb-2 mr-sm-2 mb-sm-0"
                :options= options
                :value="null"
                ></b-form-select>
            </b-input-group>         
            </b-form-group>

            <b-form-group
                id="input-group-1"                
                label-for="input-1"                
            >
            <b-input-group prepend="Numero identificación:" class="mb-2 mr-sm-2 mb-sm-0">
            <b-form-input                
                id="input-1"
                v-model="nroid"
                type="number"
                required
                placeholder="Digite Nro Id"
                ></b-form-input>
                </b-input-group>
            </b-form-group> 
                      
                <b-button type="submit" variant="primary">Consultar</b-button>
        </b-form>



   <!-- GRILLA DE PARTICIPANTES -->
   <div>
   <br/>
    <b-row class="bg-dark" v-if="DataCertificado"> 
        <b-col cols="3"><p class="text-light">ID</p></b-col>
        <b-col cols="3"><p class="text-light">CURSO</p></b-col>
        <b-col ><p class="text-light">DESCARGA</p></b-col>
    </b-row>
    <b-row class="border" v-for="(item,index) of DataCertificado" :key='index' >
        <b-col cols="3">{{item.Id_Participante}}</b-col>
        <!-- <b-col>{{item.nota}}</b-col> -->
        <b-col>{{item.NombreCurso}}</b-col>
        <b-col> <!-- <router-link :to="{name:'certificadopublico',params: {id:item.nombre + '|'+item.TipoId +'|'+ item.NroId + '|' + item.NombreCurso }}"> -->
            <b-button  @click="downloadWithCSS(item.nombre + '|'+item.TipoId +'|'+ item.NroId + '|' + item.NombreCurso+ '|' + item.NumeroHoras+ '|' + item.TipoDiploma)">Descargar Certificado</b-button>
                    <!-- <button v-b-modal.modal-xl class="bg-success text-white " >Descargar Certificado</button> -->
                <!-- </router-link>  -->
        </b-col>
    </b-row>
    </div>

    <div  id ="divRef" ref="content" >                  
       <!-- <img  src="@/assets/tamano3.png" alt="Certificación"  > --> 
    </div>



    </div>
</template>

<script>

import axios from 'axios'
import jsPDF from 'jspdf' 
import html2canvas from "html2canvas"

export default {
    name: 'CertificadoPublicocom',
    data(){
        return {
        options: [
          { value: null, text: 'Por favor seleccione una opción' },
          { value: 'CC', text: 'CC - Cedula de Ciudadania' },
          { value: 'CE', text: 'CC - Cedula de Extranjeria' },
          { value: 'DNI', text: 'DNI - Documento Nacional Identificación' },
          { value: 'CI', text: 'CI - Documento de Identidad' },
          { value: 'CP', text: 'CP - Ced Prof' },
          { value: 'PA', text: 'PA - Pasaporte' },
        ],
        tipoid: null,
        nroid: null,
        errors: [],
        DataCertificado:null
        }
    },  
    methods: {
        checkForm: function (e) 
        {

            this.errors = [];

            if (!this.tipoid) {
                this.errors.push('El tipoid es obligatorio.');
            }
            if (!this.nroid) {
                this.errors.push('El nroid es obligatoria.');
            }


            if (!this.errors.length) 
            {
                axios.get('https://cnbcolombia.com/node/ApiACNB/participantes/ListaCertificados',{
                params: {
                    tipoid: this.tipoid,
                    nroid: this.nroid
                }
                }).then (response =>{
                    this.DataCertificado = response.data
                })
                .catch (e => console.log(e))
            }

            e.preventDefault();
        },
        //metodo para realizar la descarga del archivo
        downloadWithCSS(nombre) {

            var arrayDatos = nombre.split('|');
            const doc = new jsPDF("l", "pt", "letter");
            var logo = new Image();

            var imgdata1 = "data:image/jpeg;base64,";

           // logo.src = path.resolve("@/assets/tamano3.png");
            var imgdata = "data:image/png;base64,";
                
            /** WITH CSS */  
            var canvasElement = document.createElement('canvas');
            var width = doc.internal.pageSize.getWidth();
            var height = doc.internal.pageSize.getHeight();
            canvasElement.width = width;
            canvasElement.height = height;
                
            html2canvas(this.$refs.content, { canvas: canvasElement 
            }).then(function (canvas) {
            const img = canvas.toDataURL("image/png", 1.0);

            if(arrayDatos[5] == 1){
                doc.addImage(imgdata,'png',20,20);
            }else{
                doc.addImage(imgdata1,'png',20,20);
            }


            var lMargin=15; //left margin in mm
            var rMargin=15; //right margin in mm
            var pdfInMM=800;  // width of A4 in mm
            var pageCenter=pdfInMM/2;

            
            var paragraph= arrayDatos[0];
            var paragraph2= "Certifica Que:";
            var paragraph3= "Asistió y completo con éxito el curso de:" + "\n" ;
            var paragraph4 = "Realizado por el Colegio Nacional de Bacteriologia CNB COLOMBIA" + "\n"
            var paragraph5 = "A través del Campus Virtual, con una intensidad horaria de ";
            var paragraph6 = arrayDatos[1];
            var paragraph7 = arrayDatos[2];
            var paragraph8 = arrayDatos[3];
            var paragraph9 = arrayDatos[4];
            var paragraph10 = arrayDatos[5];

            var currentDateWithFormat = new Date().toJSON().slice(0,10).replace(/-/g,'/');
            console.log(currentDateWithFormat);
            
            if(arrayDatos[5] == 1){
                var otorgado  = doc.splitTextToSize(paragraph, (pdfInMM-lMargin-rMargin));
                var certifica = doc.splitTextToSize(paragraph2, (pdfInMM-lMargin-rMargin));
                var asistio = doc.splitTextToSize(paragraph3, (pdfInMM-lMargin-rMargin));
                var asistio2 = doc.splitTextToSize(paragraph4, (pdfInMM-lMargin-rMargin));
                var atraves = doc.splitTextToSize(paragraph5 +' '+paragraph9 + ' horas', (pdfInMM-lMargin-rMargin));
                var tipoid = doc.splitTextToSize(paragraph6, (pdfInMM-lMargin-rMargin));
                var nroid = doc.splitTextToSize(paragraph7, (pdfInMM-lMargin-rMargin));
                var curso = doc.splitTextToSize(paragraph8, (pdfInMM-lMargin-rMargin));
                var fecha = doc.splitTextToSize(currentDateWithFormat, (pdfInMM-lMargin-rMargin));
                doc.setFontSize(15);
                doc.setTextColor(53,53,53);
                doc.text(otorgado,pageCenter,270,'center'); //see this line
                doc.text(tipoid +'. '+nroid,pageCenter,295,'center'); //see this line  
                doc.setFontSize(10);
                doc.text('Fecha de expedición  '+fecha,pageCenter,580,'center'); //see this line                               
            }else{
                var otorgado  = doc.splitTextToSize(paragraph, (pdfInMM-lMargin-rMargin));
                var certifica = "";
                var asistio = "";
                var asistio2 = "";
                var atraves = "";
                var tipoid = doc.splitTextToSize(paragraph6, (pdfInMM-lMargin-rMargin));
                var nroid = doc.splitTextToSize(paragraph7, (pdfInMM-lMargin-rMargin));
                var curso = "";
                var fecha = doc.splitTextToSize(currentDateWithFormat, (pdfInMM-lMargin-rMargin));
                doc.setFontSize(18);
                doc.setTextColor(255, 255, 255);
                doc.text(otorgado,pageCenter,220,'center'); //see this line
                doc.text(tipoid +'. '+nroid,pageCenter,250,'center'); //see this line
                doc.setFontSize(14);
                doc.text('Bogotá D.C., '+fecha,pageCenter,435,'center'); //see this line
                               
            }
             

            //doc.setFontType("bold");
            doc.text(certifica,pageCenter,240,'center'); //see this line
            
            //doc.setFont("Algerian");
            //doc.setFontType("bold");
            doc.setTextColor(53,53,53);
            doc.setFontSize(15);

            doc.setFontSize(15);
            doc.setTextColor(53,53,53);
            //doc.text(350,240, "Certifica Que:");
            doc.text(asistio,pageCenter,320,'center'); //see this line

            doc.setTextColor(53,53,53);
            //doc.setFontType("bold");
            doc.text(curso,pageCenter,345,'center'); //see this line)

            doc.setFontType("normal");
            doc.setFontSize(15);
            doc.setTextColor(53,53,53);
            //doc.text(350,240, "Certifica Que:");
            doc.text(asistio2,pageCenter,390,'center'); //see this line

            doc.setFontSize(13);
            doc.setTextColor(53,53,53);
            //doc.text(350,240, "Certifica Que:");
            doc.text(atraves,pageCenter,420,'center'); //see this line            
            

            doc.save("certificado.pdf"); 
        });
        }
    
    
    }
    
}
</script>